import { AppFeaturesComponent } from './components/app-features/app-features.component'; // Import the component

@NgModule({
  declarations: [
    AppComponent,
    AppFeaturesComponent,  // Add the component here
    // other components
  ],
  imports: [
    BrowserAnimationsModule,
    HomeModule,
    GeneralModule,
    FlightsModule,
    BrowserModule,
    AppRoutingModule,
    HttpClientModule,
    ServiceWorkerModule.register('ngsw-worker.js', {
      enabled: environment.production,
    }),
    TranslateModule.forRoot({
      loader: {
        provide: TranslateLoader,
        useFactory: HttpLoaderFactory,
        deps: [HttpClient],
      },
    }),
    NgbModule,
  ],
  providers: [TranslateService],
  bootstrap: [AppComponent],
})
export class AppModule {}
